import React from "react";
import Container from "react-bootstrap/Container";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";
import styles from "../styles/mainStyles.module.scss";

function Hero() {
  return (
    <div className={styles.heroStyle} className={styles.overlay}>
      <div className={styles.heroStyle}>
        <Container className={styles.containerStyle}>
          <h2>OSHEAGA</h2>
          <h3>Festival Musique et Arts</h3>
        </Container>
      </div>
    </div>
  );
}

export default Hero;
